nnection. Because of this, blockchain technologies that were supposed to connect isolated islands of information, ironically, helped create more of them. Lack of interoperability is one of the key reasons why blockchain technology has not yet gained widespread adoption. And the urgent need to solve this problem is what led to the Penta project.Championship.', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:05:03', '2018-03-26 15:05:03', '', '2018-03-02 00:00:00', '/files/img-video.png', '0', null), ('229', ' wo ehi  hifhdsin shfiuh  hihfsin hihi ', 'qq', null, null, '2Despite the exciting promise of such distributed ledger networks, there are still some important challenges that blockchain technology needs to overcome if it is going to serve our every day economic needs. One such problem is scalability, the ability to process an increasing amount of transactions quickly and securely without increasing transaction fees. Another challenge arises from the large amount blockchain-related projects that have popped up in recent years. The rapid evolution and deployment of blockchain technologies have created a wide variety of blockchain network systems that lack interoperability and interconnection. Because of this, blockchain technologies that were supposed to connect isolated islands of information, ironically, helped create more of them. Lack of interoperability is one of the key reasons why blockchain technology has not yet gained widespread adoption. And the urgent need to solve this problem is what led to the Penta project.Championship.', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:05:55', '2018-03-26 15:05:55', '', '2018-03-03 00:00:00', '/files/img-news.png', '0', null), ('230', 'test', 'ttea', null, null, 'Despite the exciting promise of such distributed ledger networks, there are still some important challenges that blockchain technology needs to overcome if it is going to serve our every day economic needs. One such problem is scalability, the ability to process an increasing amount of transactions quickly and securely without increasing transaction fees. Another challenge arises from the large amount blockchain-related projects that have popped up in recent years. The rapid evolution and deployment of blockchain technologies have created a wide variety of blockchain network systems that lack interoperability and interconnection. Because of this, blockchain technologies that were supposed to connect isolated islands of information, ironically, helped create more of them. Lack of interoperability is one of the key reasons why blockchain technology has not yet gained widespread adoption. And the urgent need to solve this problem is what led to the Penta project.Championship.', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:13:32', '2018-03-26 15:13:32', '/files/img-video.png', '2018-03-26 00:00:00', '/files/img-news.png', '0', null), ('231', '2Penta Eyes being the UniversalConnector in the World of Blockchains.Valspar title', 'test2', null, null, 'Despite the exciting promise of such distributed ledger networks, there are still some important challenges that blockchain technology needs to overcome if it is going to serve our every day economic needs. One such problem is scalability, the ability to process an increasing amount of transactions quickly and securely without increasing transaction fees. Another challenge arises from the large amount blockchain-related projects that have popped up in recent years. The rapid evolution and deployment of blockchain technologies have created a wide variety of blockchain network systems that lack interoperability and interconnection. Because of this, blockchain technologies that were supposed to connect isolated islands of information, ironically, helped create more of them. Lack of interoperability is one of the key reasons why blockchain technology has not yet gained widespread adoption. And the urgent need to solve this problem is what led to the Penta project.Championship.', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:20:01', '2018-03-26 15:20:01', '/files/news2.png', '2018-02-28 00:00:00', '/files/news2.png', '0', null), ('232', 'Uber is selling its South East Asia operations to rival Grab', 'test3', null, null, 'Uber is selling its South East Asia ride-share and food delivery businesses to regional rival Grab. The move marks a further retreat from international operations for Uber, after it sold its China business to local rival Didi Chuxing in 2016. Both firms are describing the deal as a win for both their companies and their passengers. Grab is South East Asia\'s most popular ride-sharing firm with millions of users across eight countries. Uber will retain a 27.5% stake in the Singapore-based company. Uber\'s chief executive will also join Grab\'s board. Image caption Rivalry has driven down costs for passengers but dented companies\' profits The value of the deal has not been made public. But it includes the sale of all of Uber\'s operations in the region, including food delivery service Uber Eats. Uber\'s chief executive Dara Khosrowshahi said this was \"a testament to Uber\'s exceptional growth across South East Asia over the last five years\". \"It will help us double down on our plans for growth as we invest heavily in our products and technology to create the best customer experience on the planet.\" Grab\'s chief executive Anthony Tan said the acquisition \"marks the beginning of a new era\". \"The combined business is the leader in platform and cost efficiency in the region. Together with Uber, we are now in an even better position to fulfil our promise to outserve our customers.\" Revenue hit by rivalry Competition in the ride-hailing sector has been fierce, resulting in discounts and promotions offered to riders and drivers reducing profit margins. But consolidation in the industry was widely expected after Japan\'s Softbank Group made a large investment in Uber earlier this year. Image caption Grab has operations in eight countries across Asia SoftBank is a major investor in several of Uber\'s rivals including Grab, China\'s Didi Chuxing and India\'s Ola. It is believed to have pushed for consolidation in order to improve revenues. Grab operates in eight countries including Singapore, Malaysia, Indonesia and Vietnam. In an interview with the BBC in February, Grab\'s boss said the firm wanted to become more relevant to users\' everyday lives and planned to expand its food delivery service. \"We want to be that app that allows you to buy your coffee, earn your rewards and then after that, you want to buy your lunch and order in, have your food delivered so you don\'t have to go through the traffic jam,\" Mr Tan said. \"And when you\'re that relevant, that real to every customer across the 600 million base, then you create huge value.\" As a result of the merger, the GrabFood service will expand from two to four South East Asian countries by next quarter, Grab said in statement. \"This will be another great use case to drive continued adoption of the GrabPay mobile wallet and support Grab\'s growing Financial Services platform,\" the firm said. Grab added that the acquisition would accelerate its path to profitability. Last year, Uber lost $4.5bn (£3.2bn) - and its chief executive - as it underwent a fundamental shake-up following a harassment scandal. In November, Uber\'s Dara Khosrowshahi, said the company\'s Asia operations were not going to be \"profitable any time soon\" and said he would like to see some changes. The firm has also exited its Russian business, selling to local firm Yandex.', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:21:27', '2018-03-26 15:21:27', '/files/news3.png', '2018-03-28 00:00:00', '/files/news3.png', '0', null), ('233', 'Liberia - the country where citizenship depends on your skin colour', 'test4', null, null, 'It is where he went to university. Where he met his wife. Where he set up his successful business. He has stayed when so many others have fled the country\'s years of unrest- determined to see the country he loves and calls home succeed. But Mr Hage, it could be argued, is a second-class citizen in Liberia. In fact, he is not a citizen at all - prohibited from becoming a full member of Liberian society because of the colour of his skin and his family\'s roots in Lebanon. \'They will enslave us\' Liberia, on Africa\'s west coast, was established as a home for freed slaves returning to the continent, escaping from unthinkable misery in the United States. Perhaps, then, it is unsurprising that when the constitution was created, a clause was put in restricting citizenship to just those of African descent, creating \"a refuge and a haven for freed men of colour\". Hundreds of years later, Liberia\'s new president, the former footballer George Weah, described the rule as \"unnecessary, racist and inappropriate\". What\'s more, Mr Weah said, discriminating against races \"contradicts the very definition of Liberia\", which is derived from the Latin word \"liber,\" meaning \"free\". The pronouncement has sent shockwaves through some parts of Liberia. \"White people will definitely enslave black Liberians,\" businessman Rufus Oulagbo tells the BBC, bluntly. Image caption Fubbi Henries at a protest against dropping the colour provision of the constitution He fears any move to widen citizenship away from just black people would damage Liberians\' chances to develop their own country. In particular, he says, allowing people from other countries to own property would be dangerous. Mr Oulagbo is not the only one to voice these fears: a new advocacy group, Citizen\'s Action Against Non-Negro Citizenship and Land Ownership, has been set up to fight the president\'s plans. \"Every nation has a foundation on which it was built - if you undermine that foundation, the nation will definitely crumble,\" the group\'s leader Fubbi Henries told the BBC. Mr Weah, he said, \"needs to focus on the right policies for Liberians\". Life after Ebola in west Africa The legacy of Africa\'s first elected female president How a footballer became president Find out more about Liberia \"Right now the prime focus is how to get our businesses on track, our agricultural and educational sectors on track, not citizenship or land ownership to non-Negroes,\" he said. It is true Mr Weah has his work cut out without changing the constitution. Despite its wealth of natural resources, Liberia is ranked 225 out of 228 countries when it comes to average income per person, at just $900 per year for 2017. In comparison, the US figure was $59,500, while the UK\'s was $43,600. In fact, a third of Liberia\'s GDP comes from those living overseas - with some families entirely dependent on remittances from the US. Mr Weah has been blunt in his assessment of the situation: Liberia is broke, and he is going to fix it. Media captionHow is Africa\'s most beloved footballer going to turn Liberia\'s economy around? After years of civil war - not to mention the devastating effect of the Ebola epidemic in 2014 - the promises are music to most Liberian ears. But changing the law now, Mr Henries says, would be like putting a two-year-old boy - Liberians - and a 45-year-old man - outsiders - in a boxing ring and seeing if they could have a fair fight. \"He will take undue advantage over that little child,\" he said. \"Liberian businesses don\'t have that same leverage.\" Harmony The fear of outsiders is nothing new. The Lebanese community is used to it. \"Probably some people might take this as a threat - that foreigners are coming to take over,\" Mr Hage tells the BBC from his home in Monrovia. \"That\'s not the case.\" At its height in the 1970s, Liberia\'s Lebanese community was 17,000-strong. Now, after Liberia\'s long civil war, it numbers around 3,000 - barely a drop in the ocean in a population of four million. At one point, Lebanese families had businesses across the country. Even now, the community owns some of the country\'s top hotels and businesses. But, says Mr Hage, that should never worry their Liberian-born neighbours. \"Lebanese were all over in this country and it wasn\'t any threat; and we have enjoyed living with Liberian people,\" he said. \"Liberian people are fine people; and we have lived together for all these years, we have had inter-marriages. The records speak for Lebanese in this country.\" In fact, he believes that should Mr Weah\'s proposal go forward, it would open the way for even more cooperation. But on a personal note, it would mean a huge amount to him. \"I have always hoped that one day the clause would be changed. \"I celebrated my 15th birthday in Liberia, I have never regretted living in Liberia. \"I am happy not because I am not a Liberian, I am happy because President Weah is looking at the future of this country,\"', 'news', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 15:22:35', '2018-03-26 15:22:35', '/files/news4.png', '2018-03-31 00:00:00', '/files/news4.png', '0', null), ('234', '326-05', 'penta', null, null, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n    <meta charset=utf-8>\r\n    <link rel=icon href=https://www.penta.global/images/icon2.png>\r\n    <meta name=viewport content=\"width=device-width,initial-scale=1\">\r\n    <title>pentapro</title>\r\n    <link href=/files/app.0e0c04c11b1ea2cdc74391500972af07.css rel=stylesheet>\r\n</head>\r\n<body>\r\n<div id=app></div>\r\n<script type=text/javascript src=/files/manifest.eeb2c031c0c552bd70ec.js></script>\r\n<script type=text/javascript src=/files/app.e888abc63928d35aac3f.js></script>\r\n</body>\r\n</html>', 'web', null, null, null, null, '0', null, '0', '1', 'emily', '2018-03-26 16:40:45', '2018-03-26 16:40:45', '', null, '', '0', null), ('235', '111', '2313123', null, null, null, 'video', null, null, null, null, '0', null, '0', '