-- ----------------------------
--  Table structure for `enterprise_info`
-- ----------------------------
DROP TABLE IF EXISTS `enterprise_info`;
CREATE TABLE `enterprise_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `created` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status` tinyint(255) DEFAULT '1' COMMENT '状态 0:禁用，1:正常',
  `enterprise_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT ' 企业名称',
  `enterprise_code` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '企业编号',
  `web_url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '官网url',
  `url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '营业执照照片url',
  `name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '法人姓名',
  `mobile` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '法人手机号',
  `cert_no` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证号码',
  `front_url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '  身份证正面url',
  `back_url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证反面面url',
  `email` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

